import { BrowserRouter, Routes, Route } from "react-router-dom";
import NotasView from "./page/notasView";
import Login from "./page/login";
import Error404 from "./page/error";
import Authorizacion from "./auth/auth";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route>
          <Authorizacion exact index element={<Login />} />
          <Authorizacion exact path="/notas" element={<NotasView />} />
          <Authorizacion exact path="/*" element={<Error404 />} />          
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
